  \"2015-11-25T17:43:24.392332\",\n\t\"name\": \"regional-air-sea-interaction-rasi-gap-wind-and-coastal-upwelling-events-climatology-gulf-o\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Regional Air-Sea Interactions (RASI)
  Gap Wind and Coastal Upwelling Events Climatology datasets were created using an
  automated intelligent algorithm which identified gap wind and coastal ocean upwelling
  events using two satellite-based microwave datasets.  The Cross-Calibrated Multi-Platform
  (CCMP) ocean surface wind data product was used for wind data while the Optimally
  Interpolated Sea Surface Temperatures (OISST) data product provided by Remote Sensing
  Systems was used for sea surface temperatures.  Data is available from 1998-2011
  for three regions in Central America: Tehuantepec, Papagayo, and Panama.  The RASI
  datasets are products resulting from DISCOVER, a NASA MEaSUREs-funded project.\",\n\t\"license_title\":
